import React from 'react';
import { Link } from 'react-router-dom';


import {BsBoxArrowUpRight} from 'react-icons/bs';

import classes from './UnitBarFirstName.module.css';

const UnitBarIDDoc=(props)=>{

//console.log("ID file: ", props.data.officeId_doc);

return (

<div className={classes.unitBarFirstName}>


    <div className={classes.firstNameTitle}> {props.docType}</div>

    <div className={classes.firstName}>  <span style={{color: "green"}}>{props.data.officeId_doc !==null && "Uploaded"}

	{props.data.officeId_doc ===null && "Not Available"}

    <Link to={{pathname: `http://127.0.0.1:8000${props.data.officeId_doc}`}}  target="_blank"><BsBoxArrowUpRight className={classes.openNewTabL}/></Link>

    </span></div>



</div>
);


}
export default UnitBarIDDoc;
